import React, { useEffect, useState } from "react";

interface AllLogFiles {
  logFileID: number;
  logFileName: string;
  logFilePath: string;
  changed: string;
}

export const ListLogFiles = () => {
  const [allLogFiles, setAllLogFiles] = useState<AllLogFiles[]>([]);
  const [error, setError] = useState<string | null>(null);

  const fetchLogFiles = async () => {
    try {
      const response = await fetch("/logFile/listLogFiles", {
        method: "GET",
        headers: {
          "Content-Type": "application/json",
        },
      });
      if (!response.ok) {
        throw new Error(`HTTP error! status: ${response.status}`);
      }
      const data = await response.json();
      setAllLogFiles(data);
      setError(null);
    } catch (error) {
      console.error("Error fetching log files:", error);
      setError("Failed to fetch log files. Please try again later.");
    }
  };

  useEffect(() => {
    fetchLogFiles();
  }, []);

  useEffect(() => {
    console.log(allLogFiles);
  }, [allLogFiles]);

  if (error) {
    return <div>Error: {error}</div>;
  }

  return (
    <div>
      <h3>Logfiles</h3>
      {allLogFiles.length === 0 ? (
        <p>No log files found.</p>
      ) : (
        <ul>
          {allLogFiles.map((logFile) => (
            <li key={logFile.logFileID}>
              {logFile.logFileName} - {logFile.logFilePath} -{" "}
              {new Date(logFile.changed).toLocaleDateString()}
            </li>
          ))}
        </ul>
      )}
    </div>
  );
};
